%spark

case class Event(serialNumber: String, 
                model: String, 
                status: String, 
                state: String, 
                temp: String, 
                signalStrength: String)

case class Series(serialNumber: String, 
                time: Int, 
                temp: String)


def createSeries(deviceEvent: RDD[Event]): RDD[Series] = {
    var seriesLoop = 0
    val deviceEventArray = deviceEvent.toArray
    var series = new Array[Series](deviceEventArray.size)
    do{
        series(seriesLoop) = new Series(deviceEventArray(seriesLoop).serialNumber, seriesLoop, deviceEventArray(seriesLoop).temp)
        seriesLoop +=1
    }while(seriesLoop < series.size)

    return sc.parallelize(series)
} 

var deviceLog = sc.textFile("/demo/data/training/DeviceLogTrainingData.csv")
