import scala.collection.mutable.ListBuffer
import org.apache.spark.rdd._
import org.apache.spark.mllib.regression.LabeledPoint
import org.apache.spark.mllib.linalg.Vectors
import org.apache.spark.mllib.feature.StandardScaler
import org.apache.spark.mllib.classification.{LogisticRegressionWithSGD, LogisticRegressionWithLBFGS, LogisticRegressionModel, SVMModel, SVMWithSGD}
import org.apache.spark.mllib.regression.LinearRegressionModel
import org.apache.spark.mllib.regression.LinearRegressionWithSGD


def extractFeatures(deviceLogPart: RDD[String]): RDD[LabeledPoint] = {
    val deviceLogList = deviceLogPart.toArray.toList
    var page = 0
    var featureWindowSize = 30
    var featureVectorSize = 10
    var alertThreshold = 105
    var deviceLogBuffer = new ListBuffer[LabeledPoint]()
    var deviceLogSize = deviceLogList.size
    var totalPages = deviceLogSize/featureWindowSize

    do{
        var featuresArray = deviceLogList.drop(page).take(featureWindowSize).toArray.map(x => x.mkString).map(x => x.split(",")(4).toDouble)
        deviceLogBuffer += LabeledPoint(if(featuresArray.max >= alertThreshold) 1.0 else 0.0, Vectors.dense(featuresArray.take(featureVectorSize)))
        if(featuresArray.drop(featureVectorSize).take(featureVectorSize)(0) <105)
            deviceLogBuffer += LabeledPoint(if(featuresArray.max >= alertThreshold) 1.0 else 0.0, Vectors.dense(featuresArray.drop(featureVectorSize).take(featureVectorSize)))
        page += featureWindowSize
    }while(page/featureWindowSize < totalPages)

    val deviceLogTrainData = sc.parallelize(deviceLogBuffer)
    return deviceLogTrainData 
}


def eval_metrics(labelsAndPreds: RDD[(Double,Double)]) : Tuple2[Array[Double], Array[Double]] = {
    val tp = labelsAndPreds.filter(r => r._1==1 && r._2==1).count.toDouble
    val tn = labelsAndPreds.filter(r => r._1==0 && r._2==0).count.toDouble
    val fp = labelsAndPreds.filter(r => r._1==1 && r._2==0).count.toDouble
    val fn = labelsAndPreds.filter(r => r._1==0 && r._2==1).count.toDouble

    val precision = tp / (tp+fp)
    val recall = tp / (tp+fn)
    val F_measure = 2*precision*recall / (precision+recall)
    val accuracy = (tp+tn) / (tp+tn+fp+fn)
    new Tuple2(Array(tp, tn, fp, fn), Array(precision, recall, F_measure, accuracy))
}

